        "body": "This should resolve issues people have with mf.dll missing errors by changing mf.dll from loadtime loading to runtime loading. If the user doesn't have Media Foundation it will try FFMpeg (if the compilation option for that was turned on) and lastly it'll fall back to the null decoder option if all else fails. I haven't throughly tested the MF -> FFMPEG fallback but it should be *good enough* i hope.\n\n<!-- Reviewable:start -->\n---\nThis change is?[<img src=\"https://reviewable.io/review_button.svg\" height=\"34\" align=\"absmiddle\" alt=\"Reviewable\"/>](https://reviewable.io/reviews/citra-emu/citra/5020)\n<!-- Reviewable:end -->\n"
