        "body": "<!---\r\n\r\nPlease read the FAQ:\r\nhttps://citra-emu.org/wiki/faq/\r\n\r\nTHIS IS NOT A SUPPORT FORUM, FOR SUPPORT GO TO:\r\nhttps://community.citra-emu.org/\r\n\r\nIf the FAQ does not answer your question, please go to:\r\nhttps://community.citra-emu.org/\r\n\r\n====================================================\r\n\r\nWhen submitting an issue, please check the following:\r\n\r\n- You have read the above.\r\n- You have provided the version (commit hash) of Citra you are using.\r\n- You have provided sufficient detail for the issue to be reproduced.\r\n- You have provided system specs (if relevant).\r\n- Please also provide:\r\n  - For any issues, a log file\r\n  - For crashes, a backtrace.\r\n  - For graphical issues, comparison screenshots with real hardware.\r\n  - For emulation inaccuracies, a test-case (if able).\r\n\r\n--->\r\n\r\nSo I open Citra, and when I enable `Use Custom Textures`, and then closing and opening Citra again, it's disabled.\r\n\r\nTested with Nightly 1376 and Canary 1495"
