        "body": "Operating System: Arch Linux x64\r\nCitra Version: master-ff931590b\r\nCPU: AMD Ryzen 5 2600X Six-Core Processor\r\nGPU: Radeon RX 580 Series (POLARIS10, DRM 3.33.0, 5.3.8-arch1-1, LLVM 9.0.0)\r\nCitra log: [citra_log.txt](https://github.com/citra-emu/citra/files/3823864/citra_log.txt)\r\n\r\n---\r\n\r\nAfter mesa 19.2.3 update, some games become unplayable\r\n\r\nfor example, in Animal Crossing: New Leaf, you can get \"ghost\" isabelle on start:\r\n![Screenshot_20191108_172611](https://user-images.githubusercontent.com/36147447/68465204-f63a3000-024c-11ea-9485-bcb0f9303069.png)\r\n\r\n...or glitched title screen in Super Smash Bros.\r\n![Screenshot_20191108_171653](https://user-images.githubusercontent.com/36147447/68465252-136efe80-024d-11ea-9d85-ebb4ed259cef.png)\r\n\r\nIn citra logs, you can see this error message spamming: \r\n```\r\nAPI ERROR 3: GL_INVALID_FRAMEBUFFER_OPERATION in glClearBufferfi(incomplete framebuffer)\r\n```\r\n\r\nSeems this commit is how this glitch happened:\r\nhttps://gitlab.freedesktop.org/mesa/mesa/commit/aab604398d53c9a49af6d7703e7dddad68cdd517\r\n\r\nAnd the code in citra:\r\nhttps://github.com/citra-emu/citra/blob/3e9c2e77d929525100f0b8b31ae583a53ef2c2dd/src/video_core/renderer_opengl/gl_rasterizer_cache.cpp#L490"
