        "body": "Hi I loaded this citra 3DS emulator for Android\r\n\r\nhttps://github.com/weihuoya/citra/releases\r\nhttps://github.com/SachinVin/citra_android/releases\r\n\r\nBut on the Samsung Galaxy S10 (Exynos 9820 CPU) with Android 9 is very slow. The FPS are extremely low and the sound is not synchronous. I tested New Super Mario Bros. 2 3DS rom (decrypted).\r\n\r\nA friend of mine uses a OnePlus 7 Pro (Snapdragon 855 CPU) and here it runs very smoothly. No problems at all.\r\n\r\nIt seems that the exynos cpu doesn't work properly, because I still have an old galaxy s6 (Samsung Exynos 7420) and the same problem here.\r\n\r\nNo problems with Qualcomm Snapdragon CPU."
