        "body": "Tested on: Canary Build - 998b5fa\r\n\r\nSystem: Windows 10, 32 GB ram, gtx 1080\r\n\r\nWhenever I switched into fullscreen (F11) the game got into Slowmotion. Everything in the game including audio was extremely slow. Once I switched to windowed mode again, it run pretty fast.\r\n\r\nThanks to @jroweboy I switched the build to 1475 and everything runs smoothly now in fullscreen. It runs much better without stuttering or any kind of lags.\r\n"
