        "closed_at": "2019-08-30T21:51:47Z",
        "author_association": "CONTRIBUTOR",
        "body": "The currently extisting Citra for Android repositories make use of `dyncom ` interpreter. Seems like this is happening due to lack of `dynarmic and xbyak` support for ARM64.\r\n\r\nJust wanted to discuss with you before I start working on implementing an ARM64 JIT compiler/assembler, to know your opinion, or to know where should I start from.\r\n\r\n1. It seems to be an already working JIT compiler developed by ARM and called `VIXL` (see here: [https://git.linaro.org/arm/vixl.git/tree/](url)) which supports both `aarch32 and aarch64`\r\n\r\n2.  The other option is to fork `xbyak` and implement aarch64 support\r\n\r\nWhich option you think is easier/more appropriate? Any other way?"
