        "title": "[Feature Request] Ability to blacklist/whitelist textures when dumping",
        "user": {
            "login": "Insidious611",
            "id": 301699,
            "node_id": "MDQ6VXNlcjMwMTY5OQ==",
            "avatar_url": "https://avatars1.githubusercontent.com/u/301699?v=4",
            "gravatar_id": "",
            "url": "https://api.github.com/users/Insidious611",
            "html_url": "https://github.com/Insidious611",
            "followers_url": "https://api.github.com/users/Insidious611/followers",
            "following_url": "https://api.github.com/users/Insidious611/following{/other_user}",
            "gists_url": "https://api.github.com/users/Insidious611/gists{/gist_id}",
            "starred_url": "https://api.github.com/users/Insidious611/starred{/owner}{/repo}",
            "subscriptions_url": "https://api.github.com/users/Insidious611/subscriptions",
            "organizations_url": "https://api.github.com/users/Insidious611/orgs",
            "repos_url": "https://api.github.com/users/Insidious611/repos",
            "events_url": "https://api.github.com/users/Insidious611/events{/privacy}",
            "received_events_url": "https://api.github.com/users/Insidious611/received_events",
            "type": "User",
            "site_admin": false
        },
        "labels": [],
        "state": "closed",
        "locked": false,
        "assignee": null,
        "assignees": [],
        "milestone": null,
        "comments": 2,
        "created_at": "2019-08-17T16:26:15Z",
        "updated_at": "2019-08-17T16:41:22Z",
        "closed_at": "2019-08-17T16:28:56Z",
        "author_association": "NONE",
        "body": "This takes a bit of explaining. I am attempting to dump the textures of the game Shin Megami Tensei IV: Apocalypse. This game uses a large amount of 2D assets alongside its 3D ones, and my intent is to, for my own use and entertainment, run a scaling filter on the 2D assets such as the enemy artwork. \r\n\r\nHowever, this game constantly creates new 512x512 textures for Render-to-Texture effects, and therefore dumping textures during gameplay results in generating thousands of PNGs even when standing still, which slows the game down to single-digit FPS even on a very fast system and means that the dump folder has to have thousands of unusable and irrelevant textures removed from it to access the useful ones.\r\n\r\nAs such, I would like a way to get around this problem. I do not know if there is a way for Citra to tell if a texture was created on the fly as a render-to-texture effect, so my idea for a solution was to be able to tell Citra not to dump textures of a certain size, in this case 512x512. The game does use 512x512 textures for a number of non-RTT textures, but they aren't generally the ones I'm interested in scaling. \r\n\r\nI realize this is a niche feature, but I expect as the new texture dumping/custom textures feature gets used more, you'll come across more games that, without some sort of way to restrict what textures are dumped, will dump more useless textures than useful ones."
