            "author_association": "NONE",
            "body": "I don't think I have a clue how to reliably reproduce this problem, but today I updated to _Citra Canary 1414_ (commit _6cfe9fe_) and after **more than an hour** of gameplay, **Citra suddenly freezes**. Audio still functions, but I can't interact with the game anymore.\r\n\r\nGPU reports the game is running at 60 FPS, but the screen is frozen. Citra (as a whole) responds, but the game that is running is frozen. Happens **repetitively** (restarting doesn't solve the issue) and is very frustrating when in some games you can't save until you finish a chapter.\r\n\r\n**Never happened before the update.** I was previously running _Canary 1406_. I suppose it has to do something with this:\r\n`Service.Y2R <Warning> core/hle/service/y2r_u.cpp:SetTransferEndInterrupt:198: (STUBBED) called`\r\n\r\nThe log file is here: [citra_log.txt](https://github.com/citra-emu/citra/files/3433030/citra_log.txt)\r\n\r\nUPDATE: It doesn't matter how long the game is running, now it happened almost immediately (in 3 minutes). Another log file, confirming the same issue: [citra_log.txt](https://github.com/citra-emu/citra/files/3433074/citra_log.txt)"
