            "body": "See yuzu-emu/yuzu#2529 for more details.\r\n\r\n**Original description**:\r\nTidies up a bit of the bootmanager code and makes it safer. Particularly, we now enforce that the parent of GRenderWindow is GMainWindow, and get rid of the downcast within the constructor, which makes the interface more type-safe.\r\n\r\nWe also now log out the destination of a screenshot rather than just saying it was saved. We also check if it actually successfully saved to disk before printing said logging message out. If we were unable to save the screenshot to disk, we now display an error message in the log.\r\n\r\nThe rest of the changes are primarily cosmetic changes made to make reading it nicer.\n\n<!-- Reviewable:start -->\n---\nThis change is?[<img src=\"https://reviewable.io/review_button.svg\" height=\"34\" align=\"absmiddle\" alt=\"Reviewable\"/>](https://reviewable.io/reviews/citra-emu/citra/4794)\n<!-- Reviewable:end -->\n"
